import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const ProfilePage = () => {
    const [profile, setProfile] = useState({});
    const [editMode, setEditMode] = useState(false);
    const [formData, setFormData] = useState({});
    const navigate = useNavigate();

    const userId = localStorage.getItem('userId'); // Retrieve the user ID from local storage

    // Fetch the profile data
    useEffect(() => {
        axios.get(`http://localhost:5000/api/profile/${userId}`)
            .then((response) => {
                setProfile(response.data);
                setFormData(response.data); // Populate the form with existing data
            })
            .catch((error) => console.error('Error fetching profile:', error));
    }, [userId]);

    // Handle input changes in the form
    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
    };

    // Update the profile
    const handleUpdateProfile = () => {
        axios.put(`http://localhost:5000/api/profile/${userId}`, formData)
            .then(() => {
                alert('Profile updated successfully');
                setProfile(formData); // Update the displayed profile
                setEditMode(false); // Exit edit mode
            })
            .catch((error) => console.error('Error updating profile:', error));
    };

    // Delete the profile
    const handleDeleteProfile = () => {
        if (window.confirm('Are you sure you want to delete your profile?')) {
            axios.delete(`http://localhost:5000/api/profile/${userId}`)
                .then(() => {
                    alert('Profile deleted');
                    localStorage.removeItem('userId'); // Clear user ID from local storage
                    navigate('/'); // Redirect to home or login page
                })
                .catch((error) => console.error('Error deleting profile:', error));
        }
    };

    return (
        <div>
            <h1>Profile Management</h1>
            {!editMode ? (
                <div>
                    <p><strong>Username:</strong> {profile.username}</p>
                    <p><strong>Email:</strong> {profile.email}</p>
                    <p><strong>Full Name:</strong> {profile.full_name}</p>
                    <p><strong>Address:</strong> {profile.address}</p>
                    <p><strong>Phone Number:</strong> {profile.phone_number}</p>
                    <button onClick={() => setEditMode(true)}>Edit Profile</button>
                    <button onClick={handleDeleteProfile} style={{ color: 'red' }}>Delete Profile</button>
                </div>
            ) : (
                <div>
                    <input
                        type="text"
                        name="username"
                        value={formData.username || ''}
                        onChange={handleInputChange}
                        placeholder="Username"
                    />
                    <input
                        type="email"
                        name="email"
                        value={formData.email || ''}
                        onChange={handleInputChange}
                        placeholder="Email"
                    />
                    <input
                        type="text"
                        name="full_name"
                        value={formData.full_name || ''}
                        onChange={handleInputChange}
                        placeholder="Full Name"
                    />
                    <textarea
                        name="address"
                        value={formData.address || ''}
                        onChange={handleInputChange}
                        placeholder="Address"
                    />
                    <input
                        type="text"
                        name="phone_number"
                        value={formData.phone_number || ''}
                        onChange={handleInputChange}
                        placeholder="Phone Number"
                    />
                    <button onClick={handleUpdateProfile}>Save Changes</button>
                    <button onClick={() => setEditMode(false)}>Cancel</button>
                </div>
            )}
        </div>
    );
};

export default ProfilePage;
